  \"2016-07-27T22:20:57.672485\",\n\t\"name\": \"management-plan-part-3-chapter2-upland-habitat-management-st-vincent-national-wildlife-ref\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This plan addresses the upland wildlife
  habitat of St. Vincent National Wildlife Refuge and the 86 acre mainland tract on
  C-30 (Franklin County). Management emphasis for the next ten years or more will
  be on forested wildlife habitat improvement, experimentation, surveys and monitoring.
  Management will include tree size, age, or density manipulations but will exclude
  cooperative-commercial sales on the island unless endangered species needs or emergencies
  dictate otherwise. Habitat manipulation decisions will be based on wildlife habitat
  and vegetative community maintenance needs determined by known species requirements.
  Silvicultural techniques or tools of the trade will be used to survey and monitor
  wildlife habitat and/or vegetative conditions.\",\n\t\"license_title\": \"License
